import React from "react";

function Navbar() {
    return (
        <>
            <div className="sidebar">
                <h2 className='welcomeAdmin'> Welcome <br></br>Admin</h2>
                <button className='logOut'>Logout <span> </span><i class="fa-solid fa-arrow-right-from-bracket"></i></button>
            </div>
        </>
    )
}

export default Navbar;
